using System;using System.Collections.Generic;using System.ComponentModel.DataAnnotations;using System.ComponentModel.DataAnnotations.Schema;namespace Asga.Public{    [Table("ContactItemTypes", Schema = "Pub")]    public partial class ContactItemType : AsgaModelBase, IAsgaModel    {        public ContactItemType()        {            ContactItems = new HashSet<ContactItem>();        }        public long Id { get; set; }        [StringLength(150)]        public string Name { get; set; }        [StringLength(300)]        public string Icon { get; set; }        public int? IconType { get; set; }        [Column(TypeName = "datetime")]        public DateTime? CreatedOn { get; set; }        public long? CreatedBy { get; set; }        [Column(TypeName = "datetime")]        public DateTime? UpdatedOn { get; set; }        public long? UpdatedBy { get; set; }        [InverseProperty("ContactItemType")]        public ICollection<ContactItem> ContactItems { get; set; }    }}